function subs(rna,rna2){
    let result = [];

    for (let i = 0; i < rna.length; ++i){

        if(rna.substr(i,rna2.length)==rna2){
            result.push(i+1);

        }
    }return result.join(' ')
}
let result=subs("","GATCTTTGA");
console.log(result);


